import  ReactDOM  from 'react-dom';
const name='prashant';
const state="maharashtra";
ReactDOM.render(
[
  <h1>Hello {name}</h1>,
  <h1>{`I am from ${state}`} </h1>]

  ,
  document.getElementById("root")
);
